import axios from "axios";
import { useEffect } from "react";
var MainPage = () => {
  useEffect(() => {
    getInitialData();
  }, []);

  async function getInitialData() {
    try {
      const response = await axios.get("https://restcountries.eu/rest/v2/all");
      console.log(response.data[0].name);
    } catch (error) {
      console.error(error);
    }
  }
  return <h1>Main</h1>;
};
export default MainPage;
